-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-summary','s:31:\"Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:168:\"This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-summary','s:52:\"Update the notification timestamp for watched pages.\";'),('en','messages:apihelp-setpagelanguage-example-default','s:83:\"Change the language of the page with ID 123 to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-example-language','s:54:\"Change the language of <kbd>Main Page</kbd> to Basque.\";'),('en','messages:apihelp-setpagelanguage-extended-description-disabled','s:174:\"Changing the language of a page is not allowed on this wiki.\n\nEnable <var>[[mw:Special:MyLanguage/Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> to use this action.\";'),('en','messages:apihelp-setpagelanguage-param-lang','s:133:\"Language code of the language to change the page to. Use <kbd>default</kbd> to reset the page to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-param-pageid','s:103:\"Page ID of the page whose language you wish to change. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-setpagelanguage-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-setpagelanguage-param-tags','s:65:\"Change tags to apply to the log entry resulting from this action.\";'),('en','messages:apihelp-setpagelanguage-param-title','s:102:\"Title of the page whose language you wish to change. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-setpagelanguage-summary','s:30:\"Change the language of a page.\";'),('en','messages:apihelp-stashedit-extended-description','s:100:\"This is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages: