en.\";'),('en','messages:apihelp-tokens-extended-description','s:96:\"This module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('en','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-tokens-summary','s:38:\"Get tokens for data-modifying actions.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-unblock-param-id','s:140:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var> or <var>$1userid</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-param-user','s:121:\"Username, IP address or IP address range to unblock. Cannot be used together with <var>$1id</var> or <var>$1userid</var>.\";'),('en','messages:apihelp-unblock-param-userid','s:86:\"User ID to unblock. Cannot be used together with <var>$1id</var> or <var>$1user</var>.\";'),('en','messages:apihelp-unblock-summary','s:15:\"Unblock a user.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-extended-description','s:253:\"A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-undelete-summary','s:36:\"Restore revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:58:\"Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:547:\"Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-summary','s:52:\"Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:72:\"Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:115:\"Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:360:\"Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:57:\"Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:10:\"User name.\";'),('en','messages:apihelp-userrights-param-userid','s:8:\"User ID.\";'),('en','messages:apihelp-userrights-summary','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:61:\"Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:77:\"Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:206:\"Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepassword-param-email','s:53:\"Email address, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-password','s:21:\"Password to validate.\";'),('en','messages:apihelp-validatepassword-param-realname','s:49:\"Real name, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-user','s:80:\"User name, for use when testing account creation. The named user must not exist.\";'),('en','messages:apihelp-validatepassword-summary','s:57:\"Validate a password against the wiki\'s password policies.\";'),('en','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('en','messages:apihelp-watch-example-unwatch','s:38:\"Unwatch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('en','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('en','messages:apihelp-watch-summary','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('en','messages:apihelp-xml-param-includexmlnamespace','s:36:\"If specified, adds an XML namespace.\";'),('en','messages:apihelp-xml-param-xslt','s:144:\"If specified, adds the named page as an XSL stylesheet. The value must be a title in the {{ns:MediaWiki}} namespace ending in <code>.xsl</code>.\";'),('en','messages:apihelp-xml-summary','s:26:\"Output data in XML format.\";'),('en','messages:apihelp-xmlfm-summary','s:49:\"Output data in XML format (pretty-print in HTML).\";'),('en','messages:apisandbox','s:11:\"API sandbox\";'),('en','messages:apisandbox-add-multi','s:3:\"Add\";'),('en','messages:apisandbox-alert-field','s:37:\"The value of this field is not valid.\";'),('en','messages:apisandbox-alert-page','s:34:\"Fields on this page are not valid.\";'),('en','messages:apisandbox-api-disabled','s:33:\"The API is disabled on this site.\";'),('en','messages:apisandbox-continue','s:8:\"Continue\";'),('en','messages:apisandbox-continue-clear','s:5:\"Clear\";'),('en','messages:apisandbox-continue-help','s:199:\"{{int:apisandbox-continue}} will [https://www.mediawiki.org/wiki/API:Query#Continuing_queries continue] the last request; {{int:apisandbox-continue-clear}} will clear continuation-related parameters.\";'),('en','messages:apisandbox-deprecated-parameters','s:21:\"Deprecated parameters\";'),('en','messages:apisandbox-dynamic-error-exists','s:38:\"A parameter named \"$1\" already exists.\";'),('en','messages:apisandbox-dynamic-parameters','s:21:\"Additional parameters\";'),('en','messages:apisandbox-dynamic-parameters-add-label','s:14:\"Add parameter:\";'),('en','messages:apisandbox-dynamic-parameters-add-placeholder','s:14:\"Parameter name\";'),('en','messages:apisandbox-examples','s:8:\"Examples\";'),('en','messages:apisandbox-fetch-token','s:19:\"Auto-fill the token\";'),('en','messages:apisandbox-helpurls','s:10:\"Help links\";'),('en','messages:apisandbox-intro','s:396:\"Use this page to experiment with the <strong>MediaWiki web service API</strong>.\nRefer to [[mw:API:Main page|the API documentation]] for further details of API usage. Example: [https://www.mediawiki.org/wiki/API#A_simple_example get the content of a Main Page]. Select an action to see more examples.\n\nNote that, although this is a sandbox, actions you carry out on this page may modify the wiki.\";'),('en','messages:apisandbox-jsonly','s:46:\"JavaScript is required to use the API sandbox.\";'),('en','messages:apisandbox-load-error','s:67:\"An error occurred while loading information for API module \"$1\": $2\";'),('en','messages:apisandbox-loading','s:42:\"Loading information for API module \"$1\"...\";'),('en','messages:apisandbox-loading-results','s:24:\"Receiving API results...\";'