nLa dernire modification de la page a t effectue par [[User:$3|$3]] ([[User talk:$3|Discuter]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),('fr','messages:ancientpages','s:38:\"Pages les plus anciennement modifies\";'),('fr','messages:ancientpages-summary','s:0:\"\";'),('fr','messages:and','s:7:\"&#32;et\";'),('fr','messages:anoncontribs','s:13:\"Contributions\";'),('fr','messages:anoneditwarning','s:345:\"<strong>Attention :</strong> vous ntes pas connect(e). Votre adresse IP sera visible de tout le monde si vous faites des modifications. Si vous <strong>[$1 vous connectez]</strong> ou <strong>[$2 crez un compte]</strong>, vos modifications seront attribues  votre propre nom dutilisateur(rice) et vous aurez dautres avantages.\";'),('fr','messages:anonnotice','s:1:\"-\";'),('fr','messages:anononlyblock','s:38:\"utilisateur non enregistr uniquement\";'),('fr','messages:anonpreviewwarning','s:133:\"<em>Vous ntes pas connect(e). Sauvegarder enregistrera votre adresse IP dans lhistorique des modifications de la page.</em>\";'),('fr','messages:anontalk','s:10:\"Discussion\";'),('fr','messages:anontalkpagetext','s:625:\"----\n<em>Vous tes sur la page de discussion dun utilisateur anonyme qui na pas encore cr de compte ou qui nen utilise pas</em>.\nPour cette raison, nous devons utiliser son adresse IP pour lidentifier.\nUne adresse IP peut tre partage par plusieurs utilisateurs.\nSi vous tes un{{GENDER:||e|}} utilisat{{GENDER:|eur|rice|eur}} anonyme et si vous constatez que des commentaires qui ne vous concernent pas vous ont t adresss, vous pouvez [[Special:CreateAccount|crer un compte]] ou [[Special:UserLogin|vous connecter]] afin dviter toute confusion future avec dautres contributeurs anonymes.\";'),('fr','messages:anonuser','s:40:\"l\'utilisateur anonyme $1 de {{SITENAME}}\";'),('fr','messages:anonusers','s:80:\"{{PLURAL:$2|l\'utilisateur anonyme|les utilisateurs anonymes}} $1 de {{SITENAME}}\";'),('fr','messages:anonymous','s:88:\"{{PLURAL:$1|Utilisateur non enregistr|Utilisateurs non enregistrs}} sur {{SITENAME}}\";'),('fr','messages:api-credits','s:422:\"Dveloppeurs de lAPI :\n* Roan Kattouw (dveloppeur en chef Sept. 20072009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Yuri Astrakhan (crateur, dveloppeur en chef Sept. 2006Sept. 2007)\n* Brad Jorsch (dveloppeur en chef depuis 2013)\n\nVeuillez envoyer vos commentaires, suggestions et questions  mediawiki-api@lists.wikimedia.org\nou remplir un rapport de bogue sur https://phabricator.wikimedia.org/.\";'),('fr','messages:api-credits-header','s:13:\"Remerciements\";'),('fr','messages:api-error-badtoken','s:37:\"Erreur interne : mauvais  jeton .\";'),('fr','messages:api-error-emptypage','s:45:\"Cration de pages vide n\'est pas autorise.\";'),('fr','messages:api-error-publishfailed','s:69:\"Erreur interne : Le serveur n\'a pas pu publier le fichier temporaire.\";'),('fr','messages:api-error-stashfailed','s:73:\"Erreur interne : le serveur n\'a pas pu enregistrer le fichier temporaire.\";'),('fr','messages:api-error-unknown-warning','s:37:\"Avertissement inconnu : $1.\";'),('fr','messages:api-error-unknownerror','s:27:\"Erreur inconnue :  $1 .\";'),('fr','messages:api-exception-trace','s:15:\"$1  $2($3)\n$4\";'),('fr','messages:api-feed-error-title','s:11:\"Erreur ($1)\";'),('fr','messages:api-format-prettyprint-header','s:437:\"Voici la reprsentation HTML du format $1. HTML est utile pour le dbogage, mais inappropri pour tre utilis dans une application.\n\nSpcifiez le paramtre <var>format</var> pour modifier le format de sortie. Pour voir la reprsentation non HTML du format $1, mettez <kbd>format=$2</kbd>.\n\nVoyez la [[mw:Special:MyLanguage/API|documentation complte]], ou l[[Special:ApiHelp/main|aide de lAPI]] pour plus dinformation.\";'),('fr','messages:api-format-prettyprint-header-hyperlinked','s:422:\"Voici la reprsentation HTML du format $1. HTML est bien pour le dbogage, mais inappropri pour tre utilis dans une application.\n\nSpcifiez le paramtre <var>format</var> pour modifier le format de sortie. Pour voir la reprsentation non HTML du format $1, mettez [$3 <kbd>format=$2</kbd>].\n\nVoir la [[mw:API|documentation complte]], ou l [[Special:ApiHelp/main|aide de lAPI]] pour plus dinformation.\";'),('fr','messages:api-format-prettyprint-header-only-html','s:258:\"Ceci est une reprsentation HTML  des fins de dbogage, et nest pas appropri pour une utilisation applicative.\n\nVoir la [[mw:Special:MyLanguage/API|documentation complte]], ou l[[Special:ApiHelp/main|aide de lAPI]] pour plus dinformation.\";'),('fr','messages:api-format-prettyprint-status','s:57:\"Cette rponse serait retourne avec l\'tat HTTP $1 $2.\";'),('fr','messages:api-format-title','s:33:\"Rsultat de lAPI de MediaWiki\";'),('fr','messages:api-help-authmanager-general-usage','s:1439:\"La procdure gnrale pour utiliser ce module est la suivante :\n# Rcuprer les champs disponibles avec <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$4</kbd>, et un jeton <kbd>$5</kbd> avec <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Prsenter les champs  lutilisateur, et les lui faire soumettre.\n# Faire un envoi  ce module, en fournissant <var>$1returnurl</var> et les champs appropris.\n# Vrifier le <samp>status</samp> dans la rponse.\n#* Si vous avez reu <samp>PASS</samp> ou <samp>FAIL</samp>, cest termin. Lopration a soit russi, soit chou.\n#* Si vous avez reu <samp>UI</samp>, affichez les nouveaux champs  lutilisateur et faites-les-lui soumettre. Puis envoyez-les  ce module avec <var>$1continue</var> et lensemble des champs appropris, et recommencez ltape 4.\n#* Si vous avez reu <samp>REDIRECT</samp>, envoyez lutilisateur vers la cible <samp>redirecttarget</samp> et attendez le retour vers <var>$1returnurl</var>. Puis envoyez  ce module avec <var>$1continue</var> et tous les champs passs  lURL de retour, puis rptez ltape 4.\n#* Si vous avez reu <samp>RESTART</samp>, cela veut dire que lauthentification a fonctionn, mais nous navons pas de compte utilisateur li. Vous pouvez traiter cela comme un <samp>UI</samp> ou un <samp>FAIL</samp>.\";'),('fr','messages:api-help-authmanagerhelper-additional-params','s:375:\"Ce module accepte des paramtres supplmentaires selon les requtes dauthentification disponibles. Utiliser <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> (ou une rponse prcdente de ce module, le cas chant) pour dterminer les requtes disponibles et les champs quelles utilisent.\";'),('fr','messages:api-help-authmanagerhelper-continue','s:158:\"Cette requte est une continuation aprs une prcdente rponse <samp>UI</samp> ou <samp>REDIRECT</samp>. Cela ou <var>$1returnurl</var> est obligatoire.\";'),('fr','messages:api-help-authmanagerhelper-mergerequestfields','s:89:\"Fusionner dans un tableau le champ information de toutes les demandes d\'authentification.\";'),('fr','messages:api-help-authmanagerhelper-messageformat','s:47:\"Format  utiliser pour retourner les messages.\";'),('fr','messages:api-help-authmanagerhelper-preservestate','s:88:\"Conserver l\'tat d\'une prcdente tentative de connexion qui a chou, si possible.\";'),('fr','messages:api-help-authmanagerhelper-request','s:205:\"Utiliser cette requte dauthentification, avec l<samp>id</samp> renvoy par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd>.\";'),('fr','messages:api-help-authmanagerhelper-requests','s:264:\"Utiliser uniquement ces requtes dauthentification, avec l<samp>id</samp> renvoy par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> ou depuis une rponse prcdente de ce module.\";'),('fr','messages:api-help-authmanagerhelper-returnurl','s:578:\"Renvoyer lURL pour les flux dauthentification tiers, qui doit tre absolue. Cela ou <var>$1continue</var> est obligatoire.\n\nDs rception dune rponse <samp>REDIRECT</samp>, vous ouvrirez typiquement un navigateur ou un affichage web vers lURL <samp>redirecttarget</samp> spcifie pour un flux dauthentification tiers. Une fois ceci termin, le tiers renverra le navigateur ou laffichage web vers cette URL. Vous devez extraire toute requte ou paramtre POST de lURL et les passer comme une requte <var>$1continue</var>  ce module de lAPI.\";'),('fr','messages:api-help-datatypes','s:2274:\"Les entres dans MdiaWiki doivent tre en UTF-8  la norme NFC. MdiaWiki peut tenter de convertir dautres types dentre, mais cela peut faire chouer certaines oprations (comme les [[Special:ApiHelp/edit|modifications]] avec contrles MD5) to fail.\n\nCertains types de paramtre dans les requtes de lAPI ncessitent plus dexplication :\n;boolean\n:Les paramtres boolens fonctionnent comme des cases  cocher HTML : si le paramtre est spcifi, quelle que soit sa valeur, il est considr comme vrai. Pour une valeur fausse, enlever compltement le paramtre.\n;timestamp\n:Les horodatages peuvent tre spcifis sous diffrentes formes. Date et heure ISO 8601 est recommand. Toutes les heures sont en UTC, tout fuseau horaire inclus est ignor.\n:* Date et heure ISO 8601, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (la ponctuation et <kbd>Z</kbd> sont facultatifs)\n:* Date et heure ISO 8601 avec fractions de seconde (ignores), <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (tirets, deux-points et <kbd>Z</kbd> sont facultatifs)\n:* Format MdiaWiki, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Format numrique gnrique, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (fuseau horaire facultatif en <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, ou <kbd>-<var>##</var></kbd> sont ignors)\n:* Format EXIF, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*Format RFC 2822 (le fuseau horaire est facultatif), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format RFC 850 (le fuseau horaire est facultatif), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format ctime C, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Secondes depuis 1970-01-01T00:00:00Z sous forme dentier de 1  13 chiffres (sans <kbd>0</kbd>)\n:* La chane <kbd>now</kbd>\";'),('fr','messages:api-help-datatypes-header','s:16:\"Type de donnes\";'),('fr','messages:api-help-examples','s:32:\"{{PLURAL:$1|Exemple|Exemples}} :\";'),('fr','messages:api-help-fallback-description','s:2:\"$1\";'),('fr','messages:api-help-fallback-example','s:2:\"$1\";'),('fr','messages:api-help-fallback-parameter','s:2:\"$1\";'),('fr','messages:api-help-flag-deprecated','s:22:\"Ce module est dsuet.\";'),('fr','messages:api-help-flag-generator','s:49:\"Ce module peut tre utilis comme gnrateur.\";'),('fr','messages:api-help-flag-internal','s:105:\"<strong>Ce module est interne ou instable.</strong> Son fonctionnement peut tre modifi sans pravis.\";'),('fr','messages:api-help-flag-mustbeposted','s:45:\"Ce module naccepte que les requtes POST.\";'),('fr','messages:api-help-flag-readrights','s:43:\"Ce module ncessite des droits de lecture.\";'),('fr','messages:api-help-flag-writerights','s:46:\"Ce module ncessite des droits dcriture.\";'),('fr','messages:api-help-flags','s:0:\"\";'),('fr','messages:api-help-help-urls','s:0:\"\";'),('fr','messages:api-help-lead','s:142:\"Ceci est une page daide de lAPI de MediaWiki gnre automatiquement.\n\nDocumentation et exemples : https://www.mediawiki.org/wiki/API\";'),('fr','messages:api-help-license','s:19:\"Licence : [[$1|$2]]\";'),('fr','me