iawiki-api-announce Annonces de lAPI]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bogues et demandes]\n</div>\n<strong>tat :</strong> LAPI MdiaWiki est une interface stable et mature qui est supporte et amliore de faon active. Bien que nous essayions de lviter, nous pouvons avoir parfois besoin de faire des modifications impactantes; inscrivez-vous  [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ la liste de diffusion mediawiki-api-announce] pour tre inform des mises  jour.\n\n<strong>Requtes errones :</strong> Si des requtes errones sont envoyes  lAPI, un entte HTTP sera renvoy avec la cl MediaWiki-API-Error. La valeur de cet entte et le code derreur renvoy prendront la mme valeur. Pour plus dinformation, voyez [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<p class=\"mw-apisandbox-link\"><strong>Test :</strong> Pour faciliter le test des requtes de lAPI, voyez [[Special:ApiSandbox]].</p>\";'),('fr','messages:apihelp-main-param-action','s:24:\"Quelle action effectuer.\";'),('fr','messages:apihelp-main-param-assert','s:183:\"Vrifier si lutilisateur est connect si la valeur est <kbd>user</kbd>, ou sil a le droit dun utilisateur robot si la valeur est <kbd>bot</kbd><!-- {{int:group-bot}} ? -->.\";'),('fr','messages:apihelp-main-param-assertuser','s:64:\"Vrifier que lutilisateur actuel est lutilisateur nomm.\";'),('fr','messages:apihelp-main-param-curtimestamp','s:48:\"Inclure lhorodatage actuel dans le rsultat.\";'),('fr','messages:apihelp-main-param-errorformat','s:417:\"Format  utiliser pour la sortie du texte davertissement et derreur.\n; plaintext: Wikitexte avec balises HTML supprimes et les entits remplaces.\n; wikitext: wikitexte non analys.\n; html: HTML.\n; raw: Cl de message et paramtres.\n; none: Aucune sortie de texte, uniquement les codes erreur.\n; bc: Format utilis avant MdiaWiki 1.29. <var>errorlang</var> et <var>errorsuselocal</var> sont ignors.\";'),('fr','messages:apihelp-main-param-errorlang','s:385:\"Langue  utiliser pour les avertissements et les erreurs. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> renvoyant une liste de codes de langue, ou spcifier <kbd>content</kbd> pour utiliser la langue du contenu de ce wiki, ou spcifier <kbd>uselang</kbd> pour utiliser la mme valeur que le paramtre <var>uselang</var>.\";'),('fr','messages:apihelp-main-param-errorsuselocal','s:129:\"Sil est fourni, les textes derreur utiliseront des messages adapts  la langue dans lespace de noms {{ns:MediaWiki}}.\";'),('fr','messages:apihelp-main-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-main-param-maxage','s:134:\"Fixer lentte HTTP de contrle de cache <code>max-age</code>  ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-maxlag','s:613:\"La latence maximale peut tre utilise quand MdiaWiki est install sur un cluster de base de donnes rpliqu. Pour viter des actions provoquant un supplment de latence de rplication de site, ce paramtre peut faire attendre le client jusqu ce que la latence de rplication soit infrieure  une valeur spcifie. En cas de latence excessive, le code derreur <samp>maxlag</samp> est renvoy avec un message tel que <samp>Attente de $host : $lag secondes de dlai</samp>.<br />Voyez [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manuel: Maxlag parameter]] pour plus dinformation.\";'),('fr','messages:apihelp-main-param-origin','s:1149:\"En accdant  lAPI en utilisant une requte AJAX inter-domaines (CORS), mettre le domaine dorigine dans ce paramtre. Il doit tre inclus dans toute requte de pre-flight, et doit donc faire partie de lURI de la requte (pas du corps du POST).\n\nPour les requtes authentifies, il doit correspondre exactement  une des origines dans lentte <code>Origin</code> header, donc il doit tre fix avec quelque chose comme <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Si ce paramtre ne correspond pas  lentte <code>Origin</code>, une rponse 403 sera renvoye. Si ce paramtre correspond  lentte <code>Origin</code> et que lorigine est en liste blanche, des enttes <code>Access-Control-Allow-Origin</code> et <code>Access-Control-Allow-Credentials</code> seront positionns.\n\nPour les requtes non authentifies, spcifiez la valeur <kbd>*</kbd>. Cela positionnera lentte <code>Access-Control-Allow-Origin</code>, mais <code>Access-Control-Allow-Credentials</code> vaudra <code>false</code> et toutes les donnes spcifiques  lutilisateur seront filtres.\";'),('fr','messages:apihelp-main-param-requestid','s:105:\"Toute valeur fournie ici sera incluse dans la rponse. Peut tre utilis pour distinguer des demandes.\";'),('fr','messages:apihelp-main-param-responselanginfo','s:97:\"Inclure les langues utilises pour <var>uselang</var> et <var>errorlang</var> dans le rsultat.\";'),('fr','messages:apihelp-main-param-servedby','s:72:\"Inclure le nom dhte qui a renvoy la requte dans les rsultats.\";'),('fr','messages:apihelp-main-param-smaxage','s:135:\"Fixer lentte HTTP de contrle de cache <code>s-maxage</code>  ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-uselang','s:381:\"Langue  utiliser pour les traductions de message. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> renvoie une liste de codes de langue, ou en spcifiant <kbd>user</kbd> pour utiliser la prfrence de langue de lutilisateur actuel, ou en spcifiant <kbd>content</kbd> pour utiliser le langage du contenu de ce wiki.\";'),('fr','messages:apihelp-main-summary','s:0:\"\";'),('fr','messages:apihelp-managetags-example-activate','s:94:\"Activer une balise nomme <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-create','s:93:\"Crer une balise nomme <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-deactivate','s:90:\"Dsactiver une balise nomme <kbd>spam</kbd> avec le motif <kbd>No longer required</kbd>\";'),('fr','messages:apihelp-managetags-example-delete','s:74:\"Supprimer la balise <kbd>vandlaism</kbd> avec le motif <kbd>Misspelt</kbd>\";'),('fr','messages:apihelp-managetags-param-ignorewarnings','s:83:\"Sil faut ignorer tout avertissement qui surviendrait au cours de lopration.\";'),('fr','messages:apihelp-managetags-param-operation','s:547:\"Quelle opration effectuer :\n;create:Crer une nouvelle balise de modification pour un usage manuel.\n;delete:Supprimer une balise de modification de la base de donnes, y compris la suppression de la marque de toutes les rvisions, entres de modification rcente et entres de journal dans lesquelles elle serait utilise.\n;activate:Activer une balise de modification, permettant aux utilisateurs de lappliquer manuellement.\n;deactivate:Dsactiver une balise de modification, empchant les utilisateurs de lappliquer manuellement.\";'),('fr','messages:apihelp-managetags-param-reason','s:77:\"Un motif facultatif pour crer, supprimer, activer ou dsactiver la balise.\";'),('fr','messages:apihelp-managetags-param-tag','s:347:\"Balise  crer, supprimer, activer ou dsactiver. Pour la cration de balise, elle ne doit pas exister. Pour la suppression de balise, elle doit exister. Pour lactivation de balise, elle doit exister et ne pas tre utilise par une extension. Pour la dsactivation de balise, elle doit tre actuellement active et dfinie manuellement.\";'),('fr','messages:apihelp-managetags-param-tags','s:83:\"Modifier les balises  appliquer  lentre du journal de gestion des balises.\";'),('fr','messages:apihelp-managetags-summary','s:74:\"Effectuer des tches de gestion relatives  la modification des balises.\";'),('fr','messages:apihelp-mergehistory-example-merge','s:90:\"Fusionner lhistorique complet de  <kbd>AnciennePage</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-example-merge-timestamp','s:132:\"Fusionner les rvisions de la page <kbd>AnciennePage</kbd> jusquau <kbd>2015-12-31T04:37:41Z</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-param-from','s:112:\"Titre de la page depuis laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-mergehistory-param-fromid','s:107:\"ID de la page depuis laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-mergehistory-param-reason','s:37:\"Raison pour fusionner lhistorique.\";'),('fr','messages:apihelp-mergehistory-param-timestamp','s:250:\"Horodatage jusquauquel les rvisions seront dplaces de lhistorique de la page source vers lhistorique de la page de destination. Sil est omis, tout lhistorique de la page source sera fusionn avec celui de la page de destination.\";'),('fr','messages:apihelp-mergehistory-param-to','s:108:\"Titre de la page vers laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1toid</var>.\";'),('fr','messages:apihelp-mergehistory-param-toid','s:103:\"ID de la page vers laquelle lhistorique sera fusionn. Impossible  utiliser avec <var>$1to</var>.\";'),('fr','messages:apihelp-mergehistory-summary','s:36:\"Fusionner les historiques des pages.\";'),('fr','messages:apihelp-move-example-move','s:80:\"Renommer <kbd>Badtitle</kbd> en <kbd>Goodtitle</kbd> sans garder de redirection.\";'),('fr','messages:apihelp-move-param-from','s:82:\"Titre de la page  renommer. Impossible de lutiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-move-param-fromid','s:73:\"ID de la page  renommer. Impossible  utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-move-param-ignorewarnings','s:32:\"Ignorer tous les avertissements.\";'),('fr','messages:apihelp-move-param-movesubpages','s:42:\"Renommer les sous-pages, le cas chant.\";'),('fr','messages:apihelp-move-param-movetalk','s:47:\"Renommer la page de discussion, si elle existe.\";'),('fr','messages:apihelp-move-param-noredirect','s:30:\"Ne pas crer une redirection.\";'),('fr','messages:apihelp-move-param-reason','s:19:\"Motif du renommage.\";'),('fr','messages:apihelp-move-param-tags','s:122:\"Modifier les balises  appliquer  l\'entre du journal des renommages et  la version zro de la page de destination.\";'),('fr','messages:apihelp-move-param-to','s:25:\"Nouveau titre de la page.\";'),('fr','messages:apihelp-move-param-unwatch','s:81:\"Supprimer la page et la redirection de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-watch','s:80:\"Ajouter la page et la redirection,  la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-watchlist','s:144:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l\'utilisateur actuel, utiliser les prfrences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-move-summary','s:19:\"Dplacer une page.\";'),('fr','messages:apihelp-no-such-module','s:39:\"Le module $1 est introuvable.\";'),('fr','messages:apihelp-none-summary','s:17:\"Ne rien extraire.\";'),('fr','messages:apihelp-opensearch-example-te','s:48:\"Trouver les pages commenant par <kbd>Te</kbd>.\";'),('fr','messages:apihelp-opensearch-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-opensearch-param-limit','s:41:\"Nombre maximal de rsultats  renvoyer.\";'),('fr','messages:apihelp-opensearch-param-namespace','s:115:\"Espaces de nom  rechercher.  Ignor if <var>$1search</var> commence avec le prfixe d\'un espace de noms valide.\";'),('fr','messages:apihelp-opensearch-param-redirects','s:289:\"Comment grer les redirections :\n;return:Renvoie la redirection elle-mme.\n;resolve:Renvoie la page cible. Peut renvoyer moins de $1limit rsultats.\nPour des raisons historiques, la valeur par dfaut est return pour $1format=json et resolve pour les autres formats.\";'),('fr','messages:apihelp-opensearch-param-search','s:33:\"Chane de caractres cherche.\";'),('fr','messages:apihelp-opensearch-param-suggest','s:125:\"Ne rien faire si <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> vaut faux.\";'),('fr','messages:apihelp-opensearch-param-warningsaserror','s:115:\"Si des avertissements apparaissent avec <kbd>format=json</kbd>, renvoyer une erreur dAPI au lieu de les ignorer.\";'),('fr','messages:apihelp-opensearch-summary','s:61:\"Rechercher dans le wiki en utilisant le protocole OpenSearch.\";'),('fr','messages:apihelp-options-example-change','s:67:\"Modifier les prfrences <kbd>skin</kbd> et <kbd>hideminor</kbd>.\";'),('fr','messages:apihelp-options-example-complex','s:94:\"Rinitialiser toutes les prfrences, puis dfinir <kbd>skin</kbd> et <kbd>nickname</kbd>.\";'),('fr','messages:apihelp-options-example-reset','s:39:\"Rinitialiser toutes les prfrences\";'),('fr','messages:apihelp-options-extended-description','s:238:\"Seules les options enregistres dans le cur ou dans lune des extensions installes, ou les options avec des cls prfixes par <code>userjs-</code> (devant tre utilises dans les scripts utilisateur), peuvent tre dfinies.\";'),('fr','messages:apihelp-options-param-change','s:426:\"Liste des modifications, au format nom=valeur (par ex. skin=vector). Si aucune valeur nest fournie (pas mme un signe gal), par ex., nomoption|autreoption|, loption sera rinitialise  sa valeur par dfaut. Pour toute valeur passe contenant une barre verticale (<kbd>|</kbd>), utiliser le [[Special:ApiHelp/main#main/datatypes|sparateur alternatif de valeur multiple]] pour que l\'opration soit correcte.\";'),('fr','messages:apihelp-options-param-optionname','s:94:\"Nom de loption qui doit tre dfinie avec la valeur fournie par <var>$1optionvalue</var>.\";'),('fr','messages:apihelp-options-param-optionvalue','s:62:\"La valeur de l\'option spcifie par <var>$1optionname</var>.\";'),('fr','messages:apihelp-options-param-reset','s:69:\"Rinitialise les prfrences avec les valeurs par dfaut du site.\";'),('fr','messages:apihelp-options-param-resetkinds','s:94:\"Liste des types doption  rinitialiser quand loption <var>$1reset</var> est dfinie.\";'),('fr','messages:apihelp-options-summary','s:52:\"Modifier les prfrences de l\'utilisateur courant.\";'),('fr','messages:apihelp-paraminfo-example-1','s:284:\"Afficher les informations pour <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> et <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('fr','messages:apihelp-paraminfo-example-2','s:106:\"Afficher les informations pour tous les sous-modules de <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-formatmodules','s:122:\"Liste des noms de module de mise en forme (valeur du paramtre <var>format</var>). Utiliser plutt <var>$1modules</var>.\";'),('fr','messages:apihelp-paraminfo-param-helpformat','s:29:\"Format des chanes daide.\";'),('fr','messages:apihelp-paraminfo-param-mainmodule','s:119:\"Obtenir aussi des informations sur le module principal (niveau suprieur). Utiliser plutt <kbd>$1modules=main</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-modules','s:271:\"Liste des noms de module (valeurs des paramtres <var>action</var> et <var>format</var>, ou <kbd>main</kbd>). Peut spcifier des sous-modules avec un <kbd>+</kbd>, ou tous les sous-modules avec <kbd>+*</kbd>, ou tous les sous-modules rcursivement avec <kbd>+**</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-pagesetmodule','s:90:\"Obtenir aussi des informations sur le module pageset (en fournissant titles= et ses amis).\";'),('fr','messages:apihelp-paraminfo-param-querymodules','s:198:\"Liste des noms des modules de requte (valeur des paramtres <var>prop</var>, <var>meta</var> ou <var>list</var>). Utiliser <kbd>$1modules=query+foo</kbd> au lieu de <kbd>$1querymodules=foo</kbd>.\";'),('fr','messages:apihelp-paraminfo-summary','s:52:\"Obtenir des informations sur les modules de lAPI.\";'),('fr','messages:apihelp-parse-example-page','s:18:\"Analyser une page.\";'),('fr','messages:apihelp-parse-example-summary','s:21:\"Analyser un rsum.\";'),('fr','messages:apihelp-parse-example-text','s:22:\"Analyser le wikitexte.\";'),('fr','messages:apihelp-parse-example-texttitle','s:58:\"Analyser du wikitexte, en spcifiant le titre de la page.\";'),('fr','messages:apihelp-parse-extended-description','s:550:\"Voyez les diffrents modules prop de <kbd>[[Special:ApiHelp/query|action=query]]</kbd> pour avoir de linformation sur la version actuelle dune page.\n\nIl y a plusieurs moyens de spcifier le texte  analyser :\n# Spcifier une page ou une rvision, en utilisant <var>$1page</var>, <var>$1pageid</var> ou <var>$1oldid</var>.\n# Spcifier explicitement un contenu, en utilisant <var>$1text</var>, <var>$1title</var> et <var>$1contentmodel</var>.\n# Spcifier uniquement un rsum  analyser. <var>$1prop</var> doit recevoir une valeur vide.\";'),('fr','messages:apihelp-parse-param-contentformat','s:114:\"Format de srialisation du contenu utilis pour le texte dentre. Valide uniquement si utilis avec $1text.\";'),('fr','messages:apihelp-parse-param-contentmodel','s:188:\"Modle de contenu du texte dentre. Si omis, $1title doit tre spcifi, et la valeur par dfaut sera le modle du titre spcifi. Valide uniquement quand utilis avec $1text.\";'),('fr','messages:apihelp-parse-param-disableeditsection','s:75:\"Omettre les liens de modification de section de la sortie de lanalyseur.\";'),('fr','messages:apihelp-parse-param-disablelimitreport','s:103:\"Omettre le rapport de limite (rapport de limite du nouveau PP) de la sortie de lanalyseur.\";'),('fr','messages:apihelp-parse-param-disablepp','s:53:\"Utiliser <var>$1disablelimitreport</var>  la place.\";'),('fr','messages:apihelp-parse-param-disablestylededuplication','s:79:\"Ne pas dupliquer les feuilles de style incluses, dans la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-param-disabletidy','s:99:\"Ne pas excuter de nettoyage du code HTML (par exemple,  ragencer) sur la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-param-disabletoc','s:46:\"Omettre la table des matires dans la sortie.\";'),('fr','messages:apihelp-parse-param-effectivelanglinks','s:101:\"Inclut les liens de langue fournis par les extensions ( utiliser avec <kbd>$1prop=langlinks</kbd>).\";'),('fr','messages:apihelp-parse-param-generatexml','s:132:\"Gnrer un arbre danalyse XML (ncessite le modle de contenu <code>$1</code>; remplac par <kbd>$2prop=parsetree</kbd>).\";'),('fr','messages:apihelp-parse-param-oldid','s:89:\"Analyser le contenu de cette rvision. crase <var>$1page</var> et <var>$1pageid</var>.\";'),('fr','messages:apihelp-parse-param-onlypst','s:216:\"Faire une transformation avant enregistrement (PST) de lentre, mais ne pas lanalyser. Renvoie le mme wikitexte, aprs que la PST a t applique. Valide uniquement quand utilis avec <var>$1text</var>.\";'),('fr','messages:apihelp-parse-param-page','s:103:\"Analyser le contenu de cette page. Impossible  utiliser avec <var>$1text</var> et <var>$1title</var>.\";'),('fr','messages:apihelp-parse-param-pageid','s:61:\"Analyser le contenu de cette page. crase <var>$1page</var>.\";'),('fr','messages:apihelp-parse-param-preview','s:25:\"Analyser en mode aperu.\";'),('fr','messages:apihelp-parse-param-prop','s:30:\"Quelles informations obtenir :\";'),('fr','messages:apihelp-parse-param-pst','s:131:\"Faire une transformation avant enregistrement de lentre avant de lanalyser. Valide uniquement quand utilis avec du texte.\";'),('fr','messages:apihelp-parse-param-redirects','s:108:\"Si le paramtre <var>$1page</var> ou <var>$1pageid</var> est positionn sur une redirection, la rsoudre.\";'),('fr','messages:apihelp-parse-param-revid','s:98:\"ID de rvision, pour <code><nowiki>{{REVISIONID}}</nowiki></code> et autres variables semblables.\";'),('fr','messages:apihelp-parse-param-section','s:299:\"Traiter uniquement le contenu de la section ayant ce numro.\n\nQuand la valeur est <kbd>new</kbd>, traite <var>$1text</var> et <var>$1sectiontitle</var> comme sils correspondaient  une nouvelle section de la page.\n\nLa valeur <kbd>new</kbd> nest autorise que si <var>text</var> est dfini.\";'),('fr','messages:apihelp-parse-param-sectionpreview','s:67:\"Analyser en mode aperu de section (active aussi le mode aperu).\";'),('fr','messages:apihelp-parse-param-sectiontitle','s:190:\"Nouveau titre de section quand <var>section</var> vaut <kbd>nouveau</kbd>.\n\n la diffrence de la modification de page, cela ne revient pas  <var>summary</var> quand il est omis ou vide.\";'),('fr','messages:apihelp-parse-param-summary','s:21:\"Rsum  analyser.\";'),('fr','messages:apihelp-parse-param-text','s:114:\"Texte  analyser. utiliser <var>$1title</var> ou <var>$1contentmodel</var> pour contrler le modle de contenu.\";'),('fr','messages:apihelp-parse-param-title','s:145:\"Titre de la page  laquelle appartient le texte. Si omis, <var>$1contentmodel</var> doit tre spcifi, et [[API]] sera utilis comme titre.\";'),('fr','messages:apihelp-parse-param-useskin','s:229:\"Appliquer lhabillage slectionn sur la sortie de lanalyseur. Cela peut affecter les proprits suivantes : <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('fr','messages:apihelp-parse-param-wrapoutputclass','s:62:\"classe CSS  utiliser pour formater la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categories','s:51:\"Fournit les catgories dans le wikitexte analys.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:40:\"Fournit la version HTML des catgories.\";'),('fr','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Ajoute le titre du wikitexte analys.\";'),('fr','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:93:\"Fournit les variables de configuratio