age souvent consulte; assurez-vous davoir compris les consquences de votre dmarche avant de continuer.\";'),('fr','messages:movepagetext-noredirectfixer','s:1000:\"Utilisez le formulaire ci-dessous pour renommer une page, en dplaant tout son historique vers le nouveau nom.\nLancien titre deviendra une page de redirection vers le nouveau titre.\nVrifiez bien les [[Special:DoubleRedirects|doubles redirections]] ou les [[Special:BrokenRedirects|redirections casses]].\nVous avez la responsabilit de vous assurer que les liens continuent de pointer vers leur destination suppose.\n\nNotez que la page ne sera <strong>pas</strong> dplace sil existe dj une page avec le nouveau titre, sauf si cette dernire a un historique de modifications vierge et est soit vide, soit une simple redirection. Ceci permet de renommer une page vers sa position dorigine si le dplacement savre erron, et il est impossible dcraser une page existante.\n\n<strong>Attention!</strong>\nCeci peut provoquer un changement radical et imprvu pour une page souvent consulte; assurez-vous den avoir compris les consquences avant de continuer.\";'),('fr','messages:movereason','s:7:\"Motif :\";'),('fr','messages:movesubpage','s:25:\"Sous-page{{PLURAL:$1||s}}\";'),('fr','messages:movesubpagetalktext','s:99:\"La page de discussion correspondante a $1 {{PLURAL:$1|sous-page|sous-pages}} affiches ci-dessous.\";'),('fr','messages:movesubpagetext','s:83:\"Cette page a $1 {{PLURAL:$1|sous-page affiche|sous-pages affiches}} ci-dessous.\";'),('fr','messages:movetalk','s:46:\"Renommer aussi la page de discussion associe\";'),('fr','messages:movethispage','s:19:\"Renommer cette page\";'),('fr','messages:moveuserpage-warning','s:201:\"<strong>Attention :</strong> Vous tes sur le point de renommer une page dutilisateur. Veuillez noter que seule la page sera renomme et que lutilisateur <em>ne</em> sera <em>pas</em> renomm.\";'),('fr','messages:mw-widgets-categoryselector-add-category-placeholder','s:25:\"Ajouter une catgorie...\"